svg.script:
		//Base element we're filling.
		selector = "polygon";
		canaryId = "h:1:1";

  		//Define the colors.
		borderColor = "#D2BC76";
		fillColors = new Array ("#705540","#FACF00","#1E5F00","#A3D000","#D78882","#DEDACA","#374049","#3893E0","#8000FF"); 
		                        // canyon   desert     forest   grass   flower    location, mountain, water, purple
		defaultColor = "#3893E0";

		function changeFill(evt) {
			//Click to change the color of a tile.
			var element = evt.target;
			if (element.getAttribute("fill") && element.getAttribute("fill") == defaultColor) {
				//Use a random color and return.
				randomFill(element);
			} else {
				element.setAttribute("fill",defaultColor);
			}
			return;
		}		

		function initFill() {
			//Initialize the board with locations and seed terrain, then fill in the rest.

			//If the board isn't blank (saved user output), don't initialize.
			if (document.getElementById(canaryId).getAttribute("fill")) 
				return;

			var baseElt = document.querySelector("svg");
			var elts = baseElt.querySelectorAll(selector);
			for (j = 0; j < elts.length; j++) {
				randomFill(elts[j]);
			}

			//Init the viewbox.
			//shape = document.getElementsByTagName("svg")[0];
			//shape.setAttribute("viewBox", "0 0 250 550"); 
		}

		function randomFill(element,colorArray) {
			//Fill in a tile at random from a provided color list (colorArray) or from the full color list.
			if (!colorArray || colorArray.length == 0) 
				colorArray = fillColors.slice(0);
			var index = Math.floor(colorArray.length*Math.random());
			setFillAndFilter(element,colorArray[index]);
		}

		function setFillAndFilter(element,color) {
			defaultColor = color;
			element.setAttribute("fill",color);
			element.setAttribute("stroke",borderColor);
		}

		//Onload.
		var baseElt = document.querySelector("svg");
		baseElt.addEventListener("load",function() {
			initFill();
			var elts = baseElt.querySelectorAll(selector);
			for (var i = 0, length = elts.length; i < length; i++) {
				elts[i].addEventListener("click",changeFill, false);
			}
		});
